INSERT INTO `page_node` VALUES('about', 'goteo', 'es', '<p>\r\n	<span id="AMA22-1" style="font-weight: bold;">Qu&eacute; es Goteo</span><br />\r\n	<br />\r\n	Goteo es una investigaci&oacute;n para desarrollar una incubadora de proyectos de innovaci&oacute;n cultural. Parte de estudiar los modelos actuales del llamado Giving 2.0, aplicados mayoritariamente al emprendizaje social, para observar la viabilidad de estas experiencias y herramientas en el sector creativo. Mediante una red social donde se presenten los proyectos, se quiere poner a prueba nuevos sistemas de recaudaci&oacute;n de fondos, as&iacute; como tambi&eacute;n ensayar formulas participativas para evaluar y seleccionar las mejores ideas. Por otro lado, la investigaci&oacute;n apunta a concebir un procedimiento que ayude a conectar las ideas provenientes del &aacute;mbito cultural con otros &aacute;mbitos (como el social, educativo, tecnol&oacute;gico, de la salud, etc.) y organizar puntualmente sesiones de trabajo intensivo entre los creadores y las organizaciones interesadas en apoyar los proyectos seleccionados.<br />\r\n	<br />\r\n	* Goteo es una incubadora de proyectos que produce y conecta las buenas ideas con los contextos que las necesitan;<br />\r\n	* una red social en Internet que posibilita las micro-donaciones del p&uacute;blico cultural, instituciones y empresas a los proyectos innovadores de su elecci&oacute;n: una v&iacute;a alternativa de financiaci&oacute;n acorde con los nuevos modelos digitales;<br />\r\n	* una plataforma eficiente, abierta y productiva capaz de conectar a los creadores culturales con la gente de su comunidad: un punto de encuentro para la participaci&oacute;n ciudadana en las futuras agendas culturales;<br />\r\n	* un referente nacional de innovaci&oacute;n cultural distribuida.<br />\r\n	<br style="font-weight: bold;" />\r\n	<span id="AMA22-2" style="font-weight: bold;">Qu&eacute; aborda la investigaci&oacute;n</span><br />\r\n	<br />\r\n	* B&uacute;squeda y an&aacute;lisis de experiencias y herramientas que sirvan de modelo.<br />\r\n	* Asesor&iacute;as t&eacute;cnicas (seguridad en la red), legales y administrativas.<br />\r\n	* Crear las bases para desarrollar un prototipo.<br />\r\n	<br />\r\n	<span id="AMA22-3" style="font-weight: bold;">Marco de la investigaci&oacute;n</span><br />\r\n	<br />\r\n	Con frecuencia, el funcionamiento de las redes peer to peer (de igual a igual), tambi&eacute;n<br />\r\n	llamadas P2P, se ha descrito como una &quot;econom&iacute;a de obsequios&quot; en la que cada uno de los miembros de cierta comunidad contribuye, seg&uacute;n sus capacidades y habilidades, en la construcci&oacute;n de un com&uacute;n. Este com&uacute;n, sin embargo, no es un valor de cambio para el mercado convencional, sino que se convierte en un valor de uso para aquella comunidad de usuarios concreta.<br />\r\n	<br />\r\n	En esta l&iacute;nea, podemos hablar del surgimiento de nuevas formas de econom&iacute;a<br />\r\n	alternativa: en efecto, la emergencia de las redes P2P ha coincidido en el tiempo con el &eacute;xito de los sistemas de comercio de intercambio locales y el uso de las monedas complementarias, por citar algunos ejemplos.<br />\r\n	<br />\r\n	Asimismo, la aparici&oacute;n de Internet y las redes P2P ha hecho posible que el intermediario deje de ser necesario en los procesos de intercambio. As&iacute;, eBay hizo que las compras no necesitaran intermediarios. Napster, en sus inicios, hizo lo mismo con la m&uacute;sica y Wikipedia lo ha hecho con la informaci&oacute;n.<br />\r\n	<br />\r\n	En el &aacute;mbito filantr&oacute;pico, Internet ha dado lugar a la aparici&oacute;n del concepto Giving 2.0 (Donaciones 2.0): el intermediario entre las entidades beneficiarias y los donantes tambi&eacute;n ha dejado de ser necesario. Se han creado mercados de donaciones con base en Internet que son capaces de redireccionar el donante hacia el posible beneficiario de la donaci&oacute;n, ayudando al primero a que identifique las entidades sin &aacute;nimo de lucro, los proyectos o necesidades individuales que m&aacute;s le interesan y as&iacute; poder contribuir.<br />\r\n	Del mismo modo, los beneficiarios pueden acceder a una amplia base de datos de posibles contribuidores. Organizaciones peque&ntilde;as y con un acceso dif&iacute;cil a los recursos han sido capaces, gracias al Giving 2.0, de financiar con &eacute;xito proyectos sostenibles y durables en el tiempo, sin la necesidad de apoyo gubernamental. Todo esto gracias al fen&oacute;meno del e-social banking (banca electr&oacute;nica social) y las P2P Charities (Beneficencias P2P).</p>\r\n<p>\r\n	En la banca electr&oacute;nica social, los &quot;bancos&quot; son plataformas P2P que facilitan pr&eacute;stamos a trav&eacute;s de una red de usuarios 2.0 con una finalidad social. Estos bancos son una especie dentro de las Beneficencias P2P.<br />\r\n	<br />\r\n	Las llamadas P2P Charities aparecieron como consecuencia del potencial de la Web 2.0 y de los esc&aacute;ndalos, la opacidad informativa y los altos costes de algunas ONGs. Hoy las Beneficencias P2P son aut&eacute;nticos &quot;mercados solidarios&quot; donde proyectos de todo el mundo buscan (y encuentran) padrinos alrededor del planeta.<br />\r\n	<br />\r\n	Uno de los ejemplos m&aacute;s famosos de Beneficencia P2P es Kiva (www.kiva.org), que<br />\r\n	interviene en 45 pa&iacute;ses en v&iacute;as de desarrollo y suministra fondos a m&aacute;s de 60.000<br />\r\n	emprendedores. Hoy ya cuenta con colaboradores tan importantes como PayPal, Google, YouTube, Facebook, Intel o Yahoo. Otra entidad digna de menci&oacute;n es GlobalGiving&nbsp; (www.globalgiving.com), que ofrece peri&oacute;dicamente la oportunidad de enviar proyectos para que sea tenido en cuenta a la hora de repartir los fondos recaudados por todo el mundo. Adem&aacute;s, con objetivos similares, Donors Choose (www.donorschoose.org) ha alcanzado el &eacute;xito como catalizador de la donaci&oacute;n filantr&oacute;pica en Internet.<br />\r\n	La clave del funcionamiento del Giving 2.0 es el poder potencial de las masas unido al alcance transfronterizo de Internet. Las Beneficencias P2P aprovechan las nuevas tecnolog&iacute;as y se adaptan para incentivar la participaci&oacute;n ciudadana alrededor del mundo.<br />\r\n	<br style="font-weight: bold;" />\r\n	<span id="AMA22-4" style="font-weight: bold;">El reto de la futura red social&nbsp; GOTEO</span><br />\r\n	<br />\r\n	Hasta el momento, las din&aacute;micas del llamado Giving 2.0 (Donaciones 2.0) se han inscrito mayoritariamente en el entorno social. Platoniq busca trasladar este modelo al &aacute;mbito de la innovaci&oacute;n cultural. Podemos decir que hoy la innovaci&oacute;n consiste en el desarrollo y explotaci&oacute;n de nuevas ideas que satisfacen objetivos valiosos. Y estos objetivos no son s&oacute;lo econ&oacute;micos o tecnol&oacute;gicos, sino que incluyen, cada vez m&aacute;s, objetivos sociales y culturales.<br />\r\n	Introducir las nuevas formas de econom&iacute;a colaborativa en el sector creativo emergente es una manera de crear innovaci&oacute;n cultural. Es necesario generar un cambio en el sistema establecido y dar la posibilidad a los creadores y productores culturales de obtener recursos, no s&oacute;lo a trav&eacute;s de las v&iacute;as tradicionales de financiaci&oacute;n (generalmente, entidades p&uacute;blicas), sino tambi&eacute;n a trav&eacute;s de su propia comunidad y organizaciones privadas, las cuales, por medio de peque&ntilde;as donaciones a los creadores de su elecci&oacute;n, posibilitar&iacute;an el aumento de tejido creativo en su entorno y, a la larga, un mayor n&uacute;mero de colaboraciones entre los &aacute;mbitos cultural, social, tecnol&oacute;gico y econ&oacute;mico.</p>\r\n');
